import React from 'react';
import Table from 'react-bootstrap/Table';
import "bootstrap/dist/css/bootstrap.css";

function AboutMe () {
    return (
        <Table striped bordered hover variant="dark">
            <thead>
                <tr>
                    <th>$</th>
                    <th>Item</th>
                    <th>Quantity</th>
                </tr>
            </thead>
        </Table>
    )
};

export default AboutMe;
